import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {BrowserRouter} from 'react-router-dom'
import { UrlContextProvider } from './componenets/store/url-context';


ReactDOM.render(
    <UrlContextProvider>
<BrowserRouter>
    <App />
    </BrowserRouter>
    </UrlContextProvider>
 , document.getElementById('root')
);
